import React from "react";
import "../Navigation/Navigation_2.scss";
import {Navbar} from 'react-bootstrap';
import {Nav} from 'react-bootstrap';
class Navigation_2 extends React.Component {
  render() {
    return (
      <div>

<Navbar.Toggle bg="light" variant="light">
    
    <Nav className="mr-auto">
      <Nav.Link href="#">Account Info</Nav.Link>
      <Nav.Link href="#">Orders</Nav.Link>
      <Nav.Link href="#">Refunds</Nav.Link>
      <Nav.Link href="#">Message Center</Nav.Link>
      <Nav.Link href="#">Track Order</Nav.Link>
      <Nav.Link href="#">Statistic</Nav.Link>
      <Nav.Link href="#">Help</Nav.Link>
      <Nav.Link href="#">Log-out</Nav.Link>
      
    </Nav>
    
  </Navbar.Toggle>


        </div>
    );
  }
}

export default Navigation_2;
